var title_f28_51_29488="Rastelli classification of AV canal defects";
var content_f28_51_29488=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F86329&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F86329&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 484px\">",
"   <div class=\"ttl\">",
"    Rastelli classification of atrioventricular canal defects",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 464px; height: 208px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Rastelli type A: The most common type, in which the superior bridging leaflet is committed to the left ventricle&nbsp;with&nbsp;chordal attachments to the crest of the ventricular septum.",
"    <br>",
"     (B) Rastelli type B: The least common type, in which the superior bridging leaflet extends into the right ventricle.",
"     <br>",
"      (C) Rastelli type C: In this form, the superior bridging leaflet is even larger and has no chordal attachment to the interventricular septum, referred to as &ldquo;free floating.&rdquo; It is found in combination with other cardiac defects, such as tetralogy of Fallot, transposition of the great arteries, and heterotaxy syndromes.",
"      <div class=\"footnotes\">",
"       SB: superior bridging leaflet; AL: anterior leaflet; RLL: right lateral leaflet; IB: inferior bridging leaflet; LLL: left lateral leaflet.",
"      </div>",
"      <div class=\"reference\">",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
