var title_f28_51_29497="Superficial spreading melanoma";
var content_f28_51_29497=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F57466%7EPC%2F78826%7EPC%2F80955%7EPC%2F62105&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F57466%7EPC%2F78826%7EPC%2F80955%7EPC%2F62105&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Superficial spreading melanoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 288px; height: 206px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Asymmetry and color variegation are characteristic of superficial spreading melanomas.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of James C Shaw, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acral lentiginous melanoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 288px; height: 193px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    An acral lentiginous melanoma shows the asymmetry and color variegation of typical melanomas. They are distinguished clinically by their location on the palms, soles, or nails.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of James C Shaw, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Nodular melanoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 288px; height: 193px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Nodular melanomas present a discrete nodule, usually with dark pigmentation, although they may be amelanotic, as depicted above.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of James C Shaw, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Lentigo maligna melanoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 423px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Lentigo maligna melanoma usually arises in areas of sun-damaged skin, particularly on the head and neck. It begins as a freckle-like, tan-brown macule and gradually enlarges and develops darker or lighter asymmetric foci and raised areas, which signify dermal invasion.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Photo courtesy of Susan Swetter, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
